import { Grid, Paper } from '@material-ui/core';
import React from 'react';
import { makeStyles } from '@material-ui/core/styles';

import { sections } from '../../src/directory.data';

const useStyles = makeStyles({
  root: {
    paddingTop: 30,
  },
  // paperThree: (props) => ({

  //   minHeight: 300,
  //   background: `url(${props.imageUrl})`,
  //   // display: 'flex',
  //   // flexBasis: '100%',
  // }),
  paperThree: (props) => console.log(props),

  paperTwo: {
    minHeight: 400,
    // display: 'flex',
    // flexBasis: '100%',
  },
});

export const HomePage = () => {
  const classes = useStyles(sections);
  return (
    <Grid container spacing={3} className={classes.root}>
      {sections.slice(0, 3).map((sec) => (
        <Grid key={sec.id} item sm={4} xs={12}>
          <Paper className={classes.paperThree}>{sec.title}</Paper>
        </Grid>
      ))}
      {sections.slice(3, 6).map((sec) => (
        <Grid key={sec.id} item sm={6} xs={12}>
          <Paper className={classes.paperTwo}>{sec.title}</Paper>
        </Grid>
      ))}
    </Grid>
  );
};
